import React, { useEffect, useState } from 'react'

const Data = () => {

    const [data, setData] = useState([])
    const [name, setName] = useState("")
    const [username, setUsername] = useState("")
    const [email, setEmail] = useState("")

    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/users")
            .then(response => {
                return response.json()
            })
            .then(data => {
                setData(data)
            })
    }, []);

    return (
        <>
            {/* <div>
                { users.length > 0 && (
                    <ul>
                        { users.map(user => (
                            <li key={ user.id }>{ user.name }</li>
                        )) }
                    </ul>
                ) }
            </div> */}

            <table border="1">
                <tr>
                    <td>id</td>
                    <td>name</td>
                    <td>username</td>
                    <td>email</td>

                </tr>
                {
                    data.map((item) =>
                        <tr>
                            <td>{ item.id }</td>
                            <td>{ item.name }</td>
                            <td>{ item.username }</td>
                            <td>{ item.email }</td>
                        </tr>
                    )
                }
            </table>
        </>
    )
}

export default Data
